(5, 'eF0X9oxo4TLKqaGAodACGTJLpx2XaPKPhZ9DOfXF.png', 'LES JOURNÉES BIOMÉDICALES DU RESHAOC', 0, 'Le Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes (RESHAOC) organise du 24 au 26 octobre 2023 au Palais des Congrès de Cotonou (Bénin) et en visioconférence, un colloque international sur le thème : « Gestion des équipements médico-techniques dans les établissements de santé africains : enjeux et défis »', 'ACTIVITE-PHARE', '<p class=\"ql-align-justify\"><strong>LES JOURNÉES BIOMÉDICALES DU RESHAOC</strong> </p><p class=\"ql-align-justify\"><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfgp28amHr3q1a3ap4u3Ur1et0nBwZj0APpCVOfWBL_a17Cyg/viewform?usp=pp_url\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSfgp28amHr3q1a3ap4u3Ur1et0nBwZj0APpCVOfWBL_a17Cyg/viewform?usp=pp_url</a></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>Le Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes (RESHAOC) organise du 24 au 26 octobre 2023 au Palais des Congrès de Cotonou (Bénin) et en visioconférence, un colloque international</strong> sur le thème : « Gestion des équipements médico-techniques dans les établissements de santé africains : enjeux et défis »</p><p class=\"ql-align-justify\"><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p>Pour votre pré-inscription, veiller cliquer sur le lien :</p><p><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform</a></p><p>Pour confirmer votre inscription aux Journées Biomédicales du RESHAOC 2023, </p><p>veuillez renseigner ce formulaire et le renvoyer :</p><p>&nbsp;&nbsp;&nbsp;par mail à jbr.admn.com@gmail.com </p><p>&nbsp;&nbsp;&nbsp;ou le déposer en main propre au Secrétariat Exécutif du RESHAOC au CNHU-HKM de Cotonou (bureau du secrétariat particulier du Directeur du CNHU-HKM, Pr Dieu donné GNONLONFOUN) </p><p><br></p><p><strong><img src=\"data:image/jpeg;base64,\"></strong></p><p><strong>Régler les frais d’inscription</strong> (<u>avant le 31 août 2023</u> pour bénéficier du tarif préférentiel -25%)&nbsp;:</p><p><br></p><p><strong>PAR MOBILE MONEY </strong></p><p><strong>réservé exclusivement pour les résidents du Bénin uniquement</strong>&nbsp;: </p><ul><li><strong>MTN</strong>&nbsp;: n° <strong>(229)</strong> <strong>97 65 53 11</strong> au nom de M. GLITHO Thierry (Chargé de Communication du RESHAOC)</li><li><strong>MOOV</strong>&nbsp;: n° <strong>(229) 55 32 35 35</strong> au nom de M. GLITHO Thierry (Chargé de Communication du RESHAOC)</li></ul><p><br></p><p><strong>PAR VIREMENT BANCAIRE - RIB RESHAOC</strong></p><p>Code Banque : <strong>SOCIÉTÉ</strong> GENERALE BÉNIN, (SGB)</p><p>Intitulé du compte : SECRÉTARIAT EXÉCUTIF RESHAOC, Guichet : 0100, N° Compte : 0 106 315 230 01 Clé RIB : 68</p><p>IBAN : BJ104 0100 106 315 230 01 68,  Code SWIFT : SOGEBJBJ</p><p><br></p><p><strong>EN ESPÈCES </strong></p><p>sur place le jour J (plein tarif)</p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p>Le Comité d’organisation vous propose de gérer la réservation de votre hôtel, à un tarif négocié. Pour cela, consultez la liste des hôtels proposés en pages 3 et 4, puis complétez le formulaire ci-dessous pour nous indiquer vos préférences. Une fois le tarif et la réservation confirmés, le règlement sera à la charge de chaque participant en lien avec l’hôtel retenu.</p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p>Pour toute question, adressez-vous à <span style=\"color: rgb(0, 32, 96);\">: </span><a href=\"mailto:jbr.admn.com@gmail.com\" rel=\"noopener noreferrer\" target=\"_blank\">jbr.admn.com@gmail.com</a></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-11 19:17:58', '2023-10-08 06:45:31', NULL);
