(14, 'Ymj4uDGNvsn0MkakSB0xbSbPG8sotzX6fNrB1SB3.jpg', 'INCRIPTION AUX JBR/RESHAOC', 0, 'Les JBR rassembleront, pour la première fois et autour d’un programme scientifique ambitieux, tous les acteurs-clés concernés par les enjeux de la gestion des équipements médicaux dans les pays d’Afrique francophone : autorités de santé, directeurs d’hôpitaux, professionnels biomédicaux, professionnels de santé, instituts de formation, fournisseurs, associations professionnelles biomédicales, acteurs de coopération internationale…   Le Comité d’organisation international est convaincu que les regards croisés et les collaborations interprofessionnelles contribueront à l’amélioration de la gestion des équipements médicaux et de la maintenance.', 'ARTICLE', '<p>PROGRAMME DES ACTIVITÉS DES JBR/RESHAOC</p><p><br></p><p class=\"ql-align-justify\">Le Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes (RESHAOC) organise du 24 au 26 octobre 2023 au Palais des Congrès de Cotonou (Bénin) et en visioconférence, un colloque international sur le thème : <strong>« Gestion des équipements médico-techniques dans les établissements de santé africains : enjeux et défis » </strong>avec l’appui de ses partenaires : la Fédération Hospitalière de France, l’ONG Humatem et l’<span style=\"background-color: transparent;\">Association Française des Ingénieurs Biomédicaux (AFIB).</span></p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">Les Journées Biomédicales du RESHAOC rassembleront, pour la première fois et autour d’un programme scientifique ambitieux, tous les acteurs-clés concernés par les enjeux de la gestion des équipements médicaux dans les pays d’Afrique francophone : autorités de santé, directeurs d’hôpitaux, professionnels biomédicaux, professionnels de santé, instituts de formation, fournisseurs, associations professionnelles biomédicales, acteurs de coopération internationale… Le Comité d’organisation international est convaincu que les regards croisés et les collaborations interprofessionnelles contribueront à l’amélioration de la gestion des équipements médicaux et de la maintenance.</p><p class=\"ql-align-justify\">Rejoignez-nous dans ce challenge pour faire de cet événement une référence dans le domaine sur le continent africain !</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Inscrivez-vous avant le 31 août pour bénéficier d’un tarif préférentiel.</strong></p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong style=\"color: rgb(35, 196, 182);\"><img src=\"data:image/png;base64,\"></strong>&nbsp;</p><p class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Mardi 24 octobre /&nbsp;Journées ouvertes Grand public</strong></p><ul><li class=\"ql-align-justify\">Plénières</li><li class=\"ql-align-justify\">Espace exposants</li></ul><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Mercredi 25 octobre /&nbsp;</strong><strong style=\"background-color: transparent;\">Journées ouvertes Grand public</strong></p><ul><li class=\"ql-align-justify\">Tables-rondes</li><li class=\"ql-align-justify\">Espace exposants</li><li class=\"ql-align-justify\">Formations</li><li class=\"ql-align-justify\">Soirée de gala (sur réservation)</li></ul><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Jeudi 26 octobre / Journée restreinte&nbsp;</strong><strong style=\"background-color: transparent;\">(sur invitation)</strong></p><ul><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Atelier du Comité d’organisation international</span></li><li class=\"ql-align-justify\">Formations</li><li class=\"ql-align-justify\">Espace exposants</li></ul><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong><img src=\"data:image/png;base64,\"></strong></p><p class=\"ql-align-justify\"><strong>Cliquer sur le lien : </strong></p><p class=\"ql-align-justify\"><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform</a></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Télécharger au format PDF le <em><u>Bulletin d\'inscription congressiste Journées Biomédicales du RESHAOC 2023-1</u></em></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-justify\"><a href=\"https://forms.gle/FZECQrdedMkcG1NVA\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(255, 255, 255);\"><strong>liquez ici !</strong></a>&nbsp;</p><p class=\"ql-align-justify\">La confirmation de votre inscription et les informations pratiques vous seront communiquées par mail à partir du 1er juillet 2023.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Télécharger au format PDF le <em><u>DOSSIER EXPOSANTS PARTENAIRES JOURNÉES BIOMÉDICALES DU RESHAOC 2023-1</u></em></p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><img src=\"https://img-cache.net/im/2219208/bc5dc21ec037dc97177a80ff40e255a3d104501faf6c0076f5e746794b4ccca2.png?e=1Rt7N4v4tEe6aYGGGjkGxAzKDIf1ta4frf1_ii4ekBDdkorpE4rz8O0efRqoU1I5_K9NjWvW7CpFXW6O5uUV8ZP79QZq8RKjOVcg_cJfv1Hfp9057jPXhoo7mj6yZS1vqGViLabwc4AAXl_e8rRralJuq8XoRLO5gqJouj5n2hzQdn3a_wgeyHTFSIdxqtg9tUJIe7VWiDULlkyeuFt6\" width=\"590\"></p><p><br></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-12 10:17:27', '2023-09-24 22:41:07', NULL);
INSERT INTO `actualites` (`id`, `image`, `title`, `isvedette`, `description`, `type`, `content`, `date`, `lieu`, `fichier`, `id_actualite`, `created_at`, `updated_at`, `date_fin`) VALUES
(16, 'DuNFcYi5zA6gT0k8yP87PcdgSoL4UCiCcJreiF1S.jpg', 'PRE-INSCRIPTION AUX JBR', 0, 'Inscrivez-vous avant le 31 août pour bénéficier d’un tarif préférentiel.', 'ACTIVITE-PHARE', '<p class=\"ql-align-justify\"><strong> LES JOURNÉES BIOMÉDICALES DU RESHAOC</strong></p><p class=\"ql-align-justify\"><br></p><p>Inscrivez-vous avant le 22 septembre 2023 pour bénéficier d’un tarif préférentiel.&nbsp;<a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform</a></p><p><br></p><p class=\"ql-align-justify\">Sous le parrainage du Ministre de la Santé du Bénin, Pr Benjamin HOUNKPATIN,</p><p class=\"ql-align-justify\"><strong>Le Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes (RESHAOC) organise du 24 au 26 octobre 2023 au Palais des Congrès de Cotonou (Bénin) et en visioconférence, un colloque international</strong> sur le thème : « Gestion des équipements médico-techniques dans les établissements de santé africains : enjeux et défis » avec l’appui de ses partenaires :</p><p class=\"ql-align-justify\">§&nbsp;la Fédération Hospitalière de France,</p><p class=\"ql-align-justify\">§&nbsp;l’ONG Humatem</p><p class=\"ql-align-justify\">§&nbsp;l’Association Française des Ingénieurs Biomédicaux (AFIB).</p><p class=\"ql-align-justify\"><br></p><p>&nbsp;<img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Le Comité d’organisation international est convaincu que les regards croisés et les collaborations interprofessionnelles contribueront à l’amélioration de la gestion des équipements médicaux et de la maintenance.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Rejoignez-nous dans ce challenge pour faire de cet événement une référence dans le domaine sur le continent africain !</p><p class=\"ql-align-justify\"><a href=\"http://r.info.fhf.fr/.../InDopKw9oWt0vfqLu5PSv4uhrcyj...\" rel=\"noopener noreferrer\" target=\"_blank\">http://r.info.fhf.fr/.../InDopKw9oWt0vfqLu5PSv4uhrcyj...</a></p><p class=\"ql-align-justify\">&nbsp;</p><p>Inscrivez-vous avant le 31 août pour bénéficier d’un tarif préférentiel. <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform</a></p><p>&nbsp;</p><p><br></p><p class=\"ql-align-justify\"><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">@Reshaoc</p><p class=\"ql-align-justify\"><br></p>', '0000-00-00', NULL, 'UXYctIIavwJ5HckFWA3yuV0qoxHMTAUQdW2SW8jQ.pdf', NULL, '2023-08-13 03:50:42', '2023-09-24 22:35:24', NULL);
INSERT INTO `actualites` (`id`, `image`, `title`, `isvedette`, `description`, `type`, `content`, `date`, `lieu`, `fichier`, `id_actualite`, `created_at`, `updated_at`, `date_fin`) VALUES
(17, 'hJxu4hgWiX0gLXSm7rEpdzNMKT1ULK2DOgodjQ1L.jpg', 'JOURNÉES DE COOPÉRATION HOSPITALIÈRE INTERNATIONALE (Edition 2024, Paris)', 0, 'Mme KEBE Khadidiatou Sarr (Sen), Présidente du Réseau des Hôpitaux d’Afrique, de l’océan Indien et des Caraïbes (RESHAOC) participe à Paris à la 4e édition des Journées de Coopération Hospitalière Internationale.', 'ACTIVITE-PHARE', '<p>JOURNÉES DE COOPÉRATION HOSPITALIÈRE INTERNATIONALE (Edition 2024, Paris)</p><p><br></p><p><br></p><p><br></p><p>Mme KEBE Khadidiatou Sarr (Sen), Présidente du Réseau des Hôpitaux d’Afrique, de l’océan Indien et des Caraïbes (RESHAOC) participe à Paris à la 4e édition des Journées de Coopération Hospitalière Internationale.</p><p><br></p><p>L’objectif de ces rencontres est de faire un état des lieux de la coopération entre les institutions hospitalières, d’identifier les défis et dégager les perspectives.</p><p><br></p><p>Pour la Présidente du RESHAOC, ce lieu unique d’échanges entre acteurs de la santé mondiale est l’occasion d’insister sur la nécessité de développer des actions concrètes en matière de collaborations entre institutions hospitalières de nos pays en s’appuyant sur les ressources existantes sur nos territoires.</p><p><br></p><p>À l’occasion, plusieurs communications ont porté sur une des actions phares du Réseau est l’organisation en format hybride d’un colloque international, les 24 et 25 octobre prochains à Cotonou des Journées Biomédicales du RESHAOC (JBR) avec l\'appui de l’Association Française des Ingénieurs Biomédicaux (AFIB) et l’ONG HUMATEM. Le thème du colloque est : « GESTION DES ÉQUIPEMENTS MÉDICO-TECHNIQUES DANS LES ÉTABLISSEMENTS DE SANTÉ AFRICAINS : ENJEUX ET DÉFIS »</p><p><br></p><p>En effet, le RESHAOC est le plus ancien et le plus structuré des organisations hospitalières panafricaines. Il est en partenariat avec la Fédération Hospitalière de France (FHF), l’Agence Française de Développement, l’ONG HUMATEM et l’Association Française des Ingénieurs Biomédicaux des (AFIB).</p><p><br></p><p>@ Thierry Laurent GLITHO</p><p>RESHAOC/SE</p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-13 04:35:06', '2023-09-24 22:35:00', NULL),
(20, '2tz7R8emlbqkNzXntQZgzypJYiBI6NsngivrioNC.jpg', 'test PARTENARIAT-INTER-HOSPITALIERE', 0, 'PARTENARIAT-INTER-HOSPITALIERE', 'PARTENARIAT-INTER-HOSPITALIERE', '<h4>PARTENARIAT-INTER-HOSPITALIERE</h4><p><br></p>', NULL, NULL, 'file.pdf', NULL, '2023-08-13 15:05:58', '2023-08-13 15:05:58', NULL),
(23, '06qGHHOHBF6LdOJYPJ2LfkK9bCUEvZGjJJighVqZ.jpg', 'LES JOURNÉES BIOMÉDICALES DU RESHAOC (JBR)', 1, 'Rencontre scientifique sur les enjeux de la gestion des équipements médicaux dans les pays d’Afrique francophone', 'AGENDA', '<p class=\"ql-align-justify\"><strong>LES JOURNÉES BIOMÉDICALES DU RESHAOC</strong></p><p class=\"ql-align-justify\">Sous le parrainage du Ministre de la Santé du Bénin, Pr Benjamin HOUNKPATIN,</p><p class=\"ql-align-justify\"><strong>Le Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes (RESHAOC) organise du 24 au 26 octobre 2023 au Palais des Congrès de Cotonou (Bénin) et en visioconférence, un colloque international</strong></p><p class=\"ql-align-justify\"><br></p><p><br></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-13 19:25:24', '2023-09-24 22:56:38', NULL);
