INSERT INTO `actualites` (`id`, `image`, `title`, `isvedette`, `description`, `type`, `content`, `date`, `lieu`, `fichier`, `id_actualite`, `created_at`, `updated_at`, `date_fin`) VALUES
(25, 'Ysaa3Hzd2SOBneUuZcxU8TBazhB7Jj6hBjrvoCGa.jpg', 'INCRIPTION AUX JBR/RESHAOC', 0, 'Inscrivez-vous avant le 22 Septembre 2023 pour bénéficier d’un tarif préférentie', 'ARTICLE', '<p class=\"ql-align-justify\"><strong>LES JOURNÉES BIOMÉDICALES DU RESHAOC</strong></p><p>Inscrivez-vous avant le 22 Septembre 2023 pour bénéficier d’un tarif préférentiel.&nbsp;<a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform</a></p><p><br></p><p class=\"ql-align-justify\">Sous le parrainage du Ministre de la Santé du Bénin, Pr Benjamin HOUNKPATIN,</p><p class=\"ql-align-justify\"><strong>Le Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes (RESHAOC) organise du 24 au 26 octobre 2023 au Palais des Congrès de Cotonou (Bénin) et en visioconférence, un colloque international</strong> sur le thème : « Gestion des équipements médico-techniques dans les établissements de santé africains : enjeux et défis » avec l’appui de ses partenaires :</p><p class=\"ql-align-justify\">§&nbsp;la Fédération Hospitalière de France,</p><p class=\"ql-align-justify\">§&nbsp;l’ONG Humatem</p><p class=\"ql-align-justify\">§&nbsp;l’Association Française des Ingénieurs Biomédicaux (AFIB).</p><p class=\"ql-align-justify\"><br></p><p>&nbsp;<img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Le Comité d’organisation international est convaincu que les regards croisés et les collaborations interprofessionnelles contribueront à l’amélioration de la gestion des équipements médicaux et de la maintenance.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Rejoignez-nous dans ce challenge pour faire de cet événement une référence dans le domaine sur le continent africain !</p><p class=\"ql-align-justify\"><a href=\"http://r.info.fhf.fr/.../InDopKw9oWt0vfqLu5PSv4uhrcyj...\" rel=\"noopener noreferrer\" target=\"_blank\">http://r.info.fhf.fr/.../InDopKw9oWt0vfqLu5PSv4uhrcyj...</a></p><p class=\"ql-align-justify\">&nbsp;</p><p>Inscrivez-vous avant le 31 août pour bénéficier d’un tarif préférentiel. <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform</a></p><p>&nbsp;</p><p><br></p><p class=\"ql-align-justify\"><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">@Reshaoc</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p><br></p><p><br></p><p><br></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-14 19:04:00', '2023-09-30 10:16:44', NULL);
INSERT INTO `actualites` (`id`, `image`, `title`, `isvedette`, `description`, `type`, `content`, `date`, `lieu`, `fichier`, `id_actualite`, `created_at`, `updated_at`, `date_fin`) VALUES
(26, '4B15uqq7TmhmIfFtbVcGzaqWeQN16xloW7YclmwQ.jpg', '10es journées du RESHAOC : 3 jours consacrés aux risques professionnels et aux catastrophes en milieu hospitalier', 0, '10es Journées RESHAOC : Ouagadougou, capitale d`hôpitaux francophones Mardi 1er avril 2014. Ouagadougou. Centre international des conférences de Ouaga 2000. Le Réseau des hôpitaux de l`Afrique, de l`Océan Indien et des Caraïbes (RESHAOC) a ouvert les travaux de ses 10es journées placées sous le thème \"Gestion des risques professionnels et des catastrophes en milieu hospitalier\"', 'ARTICLE', '<p>10es journées du RESHAOC : 3 jours consacrés aux risques professionnels et aux catastrophes en milieu hospitalier</p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(153, 153, 153);\">Publié le mercredi 2 avril 2014&nbsp;|&nbsp;&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(153, 153, 153);\">aOuaga.com</strong></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Les 10es journées du Réseau des hôpitaux d\'Afrique, de l\'Océan Indien et des Caraïbes (RESHAOC) se tiennent du 1er au 3 avril 2014 à Ouagadougou sur le thème central \"Gestion des risques professionnels et des catastrophes en milieu hospitalier\". La cérémonie d\'ouverture a eu lieu dans l\'après-midi du 1er avril.</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Les acteurs de ces journées sont les prestataires de soins, les gestionnaires du système hospitalier, les partenaires techniques et financiers et des usagers du service public hospitalier. Ils viennent des pays dont les hôpitaux sont membres du réseau à savoir le Burkina, le Bénin, le Canada, la Côte d\'Ivoire, Djibouti, la France, la Guinée, le Mali, le Maroc, le Sénégal. Ils vont plancher sur le thème central des journées qui est \"Gestion des risques professionnels et des catastrophes en milieu hospitalier\" ainsi que sur deux sous-thèmes qui sont \"Audit des pratiques professionnels\" et \"Mesure de la plateforme\". Durant les trois jours, ils vont aussi réfléchir sur la problématique des projets d\'établissements hospitaliers, la maintenance biomédicale à l\'hôpital, l\'hygiène hospitalière, la gestion des urgences médicales, la coopération inter hospitalière, la certification des hôpitaux, etc. En somme, il s\'agira d\'échanger sur tous les aspects du fonctionnement des hôpitaux.</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Les journées sont placées sous le parrainage de la Première dame Chantal Compaoré qui s\'est faite représenter à la cérémonie d\'ouverture par la ministre de la Promotion de la femme et du genre, Nestorine Sangaré. La marraine a salué l\'oeuvre et l\'existence du RESHAOC qui a vu le jour en 1996 au Burkina. Le Premier ministre Luc Adolphe Tiao s\'est fait représenter également par le ministre de la Santé, Léné Sebgo.</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Pour rappel, le RESHAOC a été créé avec pour objectifs la promotion d\'un partenariat de complémentarité entre ses membres, l\'établissement de la communication et des échanges d\'informations entre les membres, la promotion de la collaboration avec les gouvernements, les institutions sous-régionales, régionales et internationales, etc. Le professeur Abdoulaye Idrissou est l\'actuel secrétaire exécutif fu RESHAOC.</span></p><p><br></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Séni DABO[</span><span class=\"ql-cursor\">|﻿﻿</span></p><p><a href=\"http://news.aouaga.com/h/23665.html\" rel=\"noopener noreferrer\" target=\"_blank\">[0es journées du RESHAOC : 3 jours consacrés aux risques professionnels et aux catastrophes en milieu hospitalier #aOuaga_com</a>]</p><p><br></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-14 23:43:33', '2023-09-24 22:40:21', NULL),
(28, 'GZq5v8QJ8DjbfhoTdqApFLjSzryniyGAAiwaRyxG.jpg', 'ACTIVITÉS PRÉPARATOIRES DES RENCONTRES HOSPITALIÈRES DE DAKAR-2024', 0, 'l’Association Sénégalaise des Administrateurs des Services de Santé (ASASS) a organisé un débat dinatoire sur le thème : « Problématique de la performance des établissements publics de santé ».', 'ACTIVITE-PHARE', '<p>ACTIVITÉS PRÉPARATOIRES DES RENCONTRES HOSPITALIÈRES DE DAKAR-2024</p><p>&nbsp;</p><p class=\"ql-align-justify\">En prélude aux rencontre hospitalières de Dakar (Sénégal) prévue par le RESHAOC au titre de ces activités de 2024, l’Association Sénégalaise des Administrateurs des Services de Santé (ASASS) a organisé un débat dinatoire sur le thème&nbsp;: «&nbsp;Problématique de la performance des établissements publics de santé&nbsp;». </p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">La manifestation a connu la participation de tous les directeurs d’EPS du Sénégal ainsi que plusieurs doyens aujourd’hui à la retraite et qui ont tenu à rehausser de leur présence cette importante soirée sous la présidence effective de madame Khadidiatou Sarr KEBE, Présidente en exercice du RESHAOC. </p><p>&nbsp;</p><p class=\"ql-align-justify\">Le panel a été animé par deux anciens directeurs de cabinet du ministère de la santé notamment les Dr Farba Lamine Sall, Dr Mame Abdoulaye Guèye et Pr Bara Ndiaye, doyen de la faculté de médecine de pharmacie et d’odonto-stomatologie de l’Université Cheikh Anta&nbsp;Diop&nbsp;de&nbsp;Dakar.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">@RESHAOC</p><p class=\"ql-align-justify\">info@reshaoc.org</p><p><br></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-15 16:30:25', '2023-09-24 22:33:49', NULL),
(29, 'm15yELUhp8N7eWWZxO5I1vzdagrMXDscTjTNVDQz.jpg', 'ACTIVITÉS PRÉPARATOIRES DES RENCONTRES HOSPITALIÈRES DE DAKAR-2024', 0, 'l’Association Sénégalaise des Administrateurs des Services de Santé (ASASS) a organisé un débat dinatoire sur le thème : « Problématique de la performance des établissements publics de santé ».', 'ARTICLE', '<p>ACTIVITÉS PRÉPARATOIRES DES RENCONTRES HOSPITALIÈRES DE DAKAR-2024</p><p>&nbsp;</p><p class=\"ql-align-justify\">En prélude aux rencontre hospitalières de Dakar (Sénégal) prévue par le RESHAOC au titre de ces activités de 2024, l’Association Sénégalaise des Administrateurs des Services de Santé (ASASS) a organisé un débat dinatoire sur le thème&nbsp;: «&nbsp;Problématique de la performance des établissements publics de santé&nbsp;».</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">La manifestation a connu la participation de tous les directeurs d’EPS du Sénégal ainsi que plusieurs doyens aujourd’hui à la retraite et qui ont tenu à rehausser de leur présence cette importante soirée sous la présidence effective de madame Khadidiatou Sarr KEBE, Présidente en exercice du RESHAOC.</p><p>&nbsp;</p><p class=\"ql-align-justify\">Le panel a été animé par deux anciens directeurs de cabinet du ministère de la santé notamment les Dr Farba Lamine Sall, Dr Mame Abdoulaye Guèye et Pr Bara Ndiaye, doyen de la faculté de médecine de pharmacie et d’odonto-stomatologie de l’Université Cheikh Anta&nbsp;Diop&nbsp;de&nbsp;Dakar.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">@RESHAOC</p><p class=\"ql-align-justify\">info@reshaoc.org</p><p><br></p><p><br></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-08-15 16:32:06', '2023-09-24 22:39:53', NULL);
INSERT INTO `actualites` (`id`, `image`, `title`, `isvedette`, `description`, `type`, `content`, `date`, `lieu`, `fichier`, `id_actualite`, `created_at`, `updated_at`, `date_fin`) VALUES
(32, 'OkPVJMYHCg1hhVh1Ds3kdGBwGW7p1qaqZY8rF60G.jpg', 'LES JOURNÉES BIOMÉDICALES DU RESHAOC : J-3 avant la fin des tarifs préférentiels !', 0, 'J-3 avant la fin des tarifs préférentiels ! Rejoignez-nous dans ce challenge pour faire de cet événement une référence dans le domaine sur le continent africain !', 'ARTICLE', '<p><span style=\"color: rgb(0, 71, 178);\">J-3 avant la fin des tarifs préférentiels !</span></p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfgp28amHr3q1a3ap4u3Ur1et0nBwZj0APpCVOfWBL_a17Cyg/viewform?usp=pp_url\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSfgp28amHr3q1a3ap4u3Ur1et0nBwZj0APpCVOfWBL_a17Cyg/viewform?usp=pp_url</a></p><p><br></p><p class=\"ql-align-justify\">Le Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes (RESHAOC) organise du 24 au 26 octobre 2023 au Palais des Congrès de Cotonou (Bénin) et en visioconférence,un colloque international sur le thème :</p><p class=\"ql-align-justify\"><strong>« Gestion des équipements médico-techniques  dans les établissements de santé africains : enjeux et défis »</strong></p><p class=\"ql-align-justify\">avec l’appui de ses partenaires : la Fédération Hospitalière de France, l’ONG Humatem et l’<span style=\"background-color: transparent;\">Association Française des Ingénieurs Biomédicaux (AFIB).</span></p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">Les Journées Biomédicales du RESHAOC rassembleront, pour la première fois et autour d’un programme scientifique ambitieux, tous les acteurs-clés concernés par les enjeux de la gestion des équipements médicaux dans les pays d’Afrique francophone : autorités de santé, directeurs d’hôpitaux, professionnels biomédicaux, professionnels de santé, instituts de formation, fournisseurs, associations professionnelles biomédicales, acteurs de coopération internationale… Le Comité d’organisation international est convaincu que les regards croisés et les collaborations interprofessionnelles contribueront à l’amélioration de la gestion des équipements médicaux et de la maintenance.</p><p class=\"ql-align-justify\">Rejoignez-nous dans ce challenge pour faire de cet événement une référence dans le domaine sur le continent africain !</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>Inscrivez-vous avant le 31 août pour bénéficier d’un tarif préférentiel.</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(0, 71, 178);\">AU PROGRAMME</strong></p><p><strong style=\"background-color: transparent;\">Mardi 24 octobre /&nbsp;Journées ouvertes Grand public</strong></p><ul><li>Plénières</li><li>Espace exposants</li></ul><p>&nbsp;</p><p><strong>Mercredi 25 octobre /&nbsp;</strong><strong style=\"background-color: transparent;\">Journées ouvertes Grand public</strong></p><ul><li>Tables-rondes</li><li>Espace exposants</li><li>Formations</li><li>Soirée de gala (sur réservation)</li></ul><p>&nbsp;</p><p><strong>Jeudi 26 octobre / Journée restreinte&nbsp;</strong><strong style=\"background-color: transparent;\">(sur invitation)</strong></p><ul><li><span style=\"background-color: transparent;\">Atelier du Comité d’organisation international</span></li><li>Formations</li><li>Espace exposants</li></ul><p><br></p><p><strong>S’INSCRIRE COMME CONGRESSISTE : </strong><a href=\"http://r.info.fhf.fr/mk/mr/sh/7nVTPdZCTJDXPcp9kk8H6TxY9AmlM1K/QN64oxO1mQdv\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 71, 178);\">http://r.info.fhf.fr/mk/mr/sh/7nVTPdZCTJDXPcp9kk8H6TxY9AmlM1K/QN64oxO1mQdv</a></p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p><br></p><p><br></p>', '0000-00-00', NULL, 'I3WtwWujg1TOUX5ApQ1To5m6AnGuzufWgHXrEkFU.pdf', NULL, '2023-08-30 22:54:37', '2023-09-24 22:39:14', NULL);
INSERT INTO `actualites` (`id`, `image`, `title`, `isvedette`, `description`, `type`, `content`, `date`, `lieu`, `fichier`, `id_actualite`, `created_at`, `updated_at`, `date_fin`) VALUES
(33, 'WXUHkjOkUC9bjHxRRpokZufmVtbEJNRXgXJb43Ll.jpg', 'LES STATISTIQUES DES INSCRIPTIONS DES  JBR/ RESHAOC', 1, '282 PARTICIPANTS IMPLIQUÉS DANS 18 PAYS ACTUELLEMENT  : Bénin, Belgique, Burkina Fasso ; Congo-Brazzaville, Côte d’Ivoire, France, Guinée, Guyane, Gabon, Iles Comores, Mali, Maroc, Mauritanie, Niger, RDC, Sénégal, Togo, Tchad', 'ARTICLE', '<p>LES STATISTIQUES DES INSCRIPTIONS DES JOURNÉES BIOMÉDICALES DU RESHAOC</p><p class=\"ql-align-justify\"><strong style=\"color: rgb(33, 88, 104);\">19 Sept. 2023</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(33, 88, 104);\">&nbsp;</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(33, 88, 104);\">TOTAL DES INSCRITS = 282 PARTICIPANTS</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(33, 88, 104);\">– 33 %, Ingénieurs/Techniciens biomédicaux</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(33, 88, 104);\">- 23 %, Directeur d’Établissement de Santé</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(33, 88, 104);\">- 14,5 %, Autorités de Santé</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(33, 88, 104);\">- 12,4 %, Médecin/Personnel soignant</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(33, 88, 104);\">&nbsp;</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(33, 88, 104);\">18 PAYS IMPLIQUÉS ACTUELLEMENT</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(33, 88, 104);\">Bénin, Belgique, Burkina-Fasso, Congo-Brazzaville, Côte d’Ivoire, France, Guinée, Guyane, Gabon, Iles Comores, Mali, Maroc, Mauritanie, Niger, RDC, Sénégal, Togo, Tchad</span></p><p><br></p><p>Vous pouvez toujours continuer de vous inscrire, en cliquant sur le lien suivant : <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.google.com/forms/d/e/1FAIpQLSc4c7_BVs6tdhOlITFjYnbuh5fZf94X_svEYeuIhILSHdxJ-g/viewform</a></p><p><br></p><p>Pour remplir le formulaire du participant, veuillez télécharger :&nbsp;<a href=\"http://api.reshaoc.org/storage/app/public/actualite/I3WtwWujg1TOUX5ApQ1To5m6AnGuzufWgHXrEkFU.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">http://api.reshaoc.org/storage/app/public/actualite/I3WtwWujg1TOUX5ApQ1To5m6AnGuzufWgHXrEkFU.pdf</a></p><p><br></p><p>@&nbsp;RESHAOC/SE</p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-09-13 00:16:13', '2023-09-30 10:16:40', NULL),
(34, 'X7dYD3HrKPxGn5QPoPmO2uaCLYgQGVbevOJfJJFN.jpg', 'DEVENEZ PARTENAIRES OU EXPOSANTS AUX JOURNEES BIOMEDICALES DU RESHAOC', 1, 'Pour devenir Partenaires ou Exposants, veuillez remplir le formulaire de soumission que vous devez compléter, signer et renvoyer à l\'adresse mail: jbr.finances1@gmail.com.', 'ARTICLE', '<p>Les Journées Biomédicales du RESHAOC rassembleront, pour la première fois et autour d\'un programme scientifique ambitieux, tous les acteurs-clés concernés par les enjeux de la gestion des équipements médicaux dans les pays d\'Afrique francophone.</p><p><br></p><p>Pour devenir Partenaires ou Exposants, veuillez télécharger l’intégralité du formulaire de soumission à l’adresse :  <a href=\"http://api.reshaoc.org/storage/app/public/actualite/EtvfQHnF97VcMDexqBemtaaPoocDn9VG1S5C7SBJ.pdf&nbsp;\" rel=\"noopener noreferrer\" target=\"_blank\">http://api.reshaoc.org/storage/app/public/actualite/EtvfQHnF97VcMDexqBemtaaPoocDn9VG1S5C7SBJ.pdf&nbsp;</a></p><p>Adressez ce document complété et signé à l\'adresse mail: jbr.partenairesexposants@reshaoc.org</p><p><br></p><p>NB : Compte tenu des places limitées, les réservations se feront par ordre d\'arrivée des demandes.</p><p>Vous recevrez alors une facture pro-forma détaillée [devis] correspondant aux prestations sélectionnées pour règlement.</p><p><br></p><p>Modalités de règlement : virement bancaire </p><p>Intitulé du compte : SECRETARIAT EXECUTIF RESHAOC</p><p>N° Compte : 0 106 315 230 01 </p><p>Clé RIB : 68</p><p>Code Guichet : 0100</p><p>Banque : SOCIETE GENERALE BENIN (SGB)</p><p>Code banque : BJ104</p><p>IBAN : BJ104 01 00 106 315 230 01 68</p><p>Code SWIFT : SOGEBJBJ</p><p><br></p><p>@ RESHAOC/SE</p><p>Thierry&nbsp;Laurent&nbsp;GLITHO</p>', '0000-00-00', NULL, 'yFmh6dykYNcKbg2vOeD0caQeVp8uZXZmuNJqgEbp.pdf', NULL, '2023-09-30 10:16:04', '2023-10-06 12:26:26', NULL),
(35, 'hNRighZwa4GLD0WJKMuVZ9S8yPo5EYaYaOPcTSZ2.jpg', 'PROGRAMME SCIENTIFIQUE DES JOURNEES BIOMEDICALES DU RESHAOC', 1, 'Télécharger l’intégralité du programme des JBR/RESHAOC en cliquant sur : http://api.reshaoc.org/storage/app/public/actualite/GlcD0RvSUdh2L0QhmRQGahWHJ173IPHSjh1mibca.pdf', 'ACTIVITE-PHARE', '<p># RESHAOC | PROGRAMME SCIENTIFIQUE DES JOURNEES BIOMEDICALES DU RESHAOC - MARDI 24 AU JEUDI 26 OCTOBRE 2023</p><p>www.reshaoc.org</p><p><br></p><p>Télécharger l’intégralité du programme des JBR/RESHAOC en cliquant sur : <a href=\"http://api.reshaoc.org/storage/app/public/actualite/o3DvVU7yB1B7kA61Sbxnyu7FPP1GNU6GKEGkMZkV.pdf \" rel=\"noopener noreferrer\" target=\"_blank\">http://api.reshaoc.org/storage/app/public/actualite/o3DvVU7yB1B7kA61Sbxnyu7FPP1GNU6GKEGkMZkV.pdf </a></p><p>MARDI 24 OCTOBRE</p><p>8h15 - Accueil des participants</p><p><br></p><p>9h00 - Cérémonie d\'ouverture</p><p>&nbsp;&nbsp;&nbsp;Allocution du Ministre de la santé du Bénin</p><p>&nbsp;&nbsp;&nbsp;Allocutions des personnalités officielles (Ambassadeur de France, OMS, RESHAOC)</p><p>&nbsp;&nbsp;&nbsp;Présentation du comité d’organisation International</p><p><br></p><p>9h30 - SESSION D’INTRODUCTION DU RESAHOC</p><p>Modérateur : </p><p>- M. Abderrahim Farid BENHAGOUG, Ingénieur biomédical en chef, AP-HM, Cercle AFIB International, Vice-président du comité scientifique des JBR (France)</p><p><br></p><p>Evolution de la situation biomédicale depuis les Rencontres hospitalières du RESHAOC de 2003</p><p>- Mme Kadidiatou SARR KEBE, Présidente du RESHAOC, _Directrice du Centre Hospitalier El Hadji Ibrahima Niass de Kaolack CHREIN (Sénégal)_, </p><p>- Pr Dieu donné GNONLONFOUN, Secrétaire exécutif du RESHAOC, Directeur Général du Centre National Hospitalier Universitaire Hubert K. MAGA, (Bénin)</p><p><br></p><p>9h45 - Plénière 1 : Définition des équipements médicaux et politiques de l\'OMS dans le domaine</p><p>10h05 - Plénière 2 : Politiques nationales et réglementation de la gestion des équipements médicaux</p><p>11h15 - Plénière 3 : Les ressources humaines biomédicales : rôles et responsabilités de l’ingénieur biomédical et du technicien biomédical dans le management du service biomédical</p><p>11h55 - Plénière 4 : La maintenance, activité-clé de la prestation biomédicale</p><p>12h35 - Plénière 5 : Politiques nationales et réglementation de la gestion des équipements médicaux</p><p>14h15 - Plénière 6 : Intérêt économique de la prestation biomédicale</p><p>14h55 - Sessions simultanées</p><p>15h35 - Plénière 7 : Présentation des outils de l\'OMS pour l\'accès aux dispositifs médicaux et du Forum AMDF</p><p>16h30 - Plénière 8 : Les ressources financières, logistiques et matérielles de l’activité biomédicale </p><p>17H10 - Table-ronde 1 - Comment définir et mobiliser des budgets d\'investissement et de maintenance adéquats pour une prestation biomédicale de qualité ?</p><p>17h50 - Synthèse</p><p><br></p><p>MERCREDI 25 OCTOBRE</p><p>9h00 - Plénière 9 : Formation initiale et continue des professionnels biomédicaux</p><p>*9h40 - Table ronde 2 *- La formation des techniciens et ingénieurs biomédicaux est-elle en adéquation avec les attentes des établissements de soins et autres employeurs ?</p><p>10h50 - Sessions simultanées</p><p>11h30 Table ronde 3 - Référentiel de bonnes pratiques biomédicales en Afrique : enjeux et intérêt</p><p>13h10 - Atelier de réflexion par catégorie professionnelle sur inscription (7 groupes répartis en 3 salles)</p><p>14h10 - Table ronde 4 - Dialogue interprofessionnel autour des préconisations et actions à mettre en œuvre pour une meilleure gestion des Équipements médicaux dans le système de santé</p><p>16h15 - Plénière 10 : Synthèse et clôture des Journées Biomédicales du RESHAOC </p><p>17H00 - Formations/initiations</p><p><br></p><p>JEUDI 26 OCTOBRE</p><p>09h00 - Sessions simultanées</p><p><br></p><p>@ RESHAOC/JBR</p><p>Thierry&nbsp;Laurent&nbsp;GLITHO</p>', '0000-00-00', NULL, 'o3DvVU7yB1B7kA61Sbxnyu7FPP1GNU6GKEGkMZkV.pdf', NULL, '2023-10-06 17:38:31', '2023-10-08 07:39:40', NULL),
(38, 'default.jpg', 'Encore quelques stands disponibles', 0, 'Il reste encore quelques stands disponibles pour exposer aux 1ères Journées Biomédicales du RESHAOC (Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes) : réservations possibles jusqu\'au dimanche 22 octobre 2023 à 23h 59.', 'ARTICLE', '<p><strong>[Journées Biomédicales du RESHAOC : 24-26 octobre à Cotonou, BENIN]</strong></p><p><br></p><p>Il reste encore quelques stands disponibles pour exposer aux 1ères Journées Biomédicales du RESHAOC (Réseau des Hôpitaux d’Afrique, de l’Océan Indien et des Caraïbes) : réservations possibles jusqu\'au dimanche 22 octobre 2023 à 23h 59.</p><p><br></p><p>Soyez au RDV de cette grande rencontre panafricaine autour des enjeux de #gestion et de #maintenance des #équipements #médicaux : + de 300 participants sur place et en visioconférence, 20 pays représentés, 9 plénières, 4 tables-rondes, 54 intervenants.</p><p><br></p><p>Un évènement organisé sous l\'égide du Ministre de la Santé du Bénin, avec la participation officielle de l\'Organisation Mondiale de la Santé.</p><p>Fédération hospitalière de France (FHF) Association Française des Ingénieurs Biomédicaux - AFIB AFD - Agence Française de Développement -&nbsp;World Health Organization</p><p><br></p><p>@ RESHAOC/JBR</p><p>Thierry&nbsp;Laurent&nbsp;GLITHO</p>', NULL, NULL, 'file.pdf', NULL, '2023-10-15 22:57:09', '2023-10-15 22:57:09', NULL),
(39, 'IXaq6AZcI91Sh2xNyRyDIyRsEpxfEvjcxRAWyxt4.jpg', 'LE LIVRET DU PARTICIPANT', 1, 'Télécharger l’intégralité du livret du participant aux JBR/RESHAOC en cliquant sur lien ci-dessous', 'ACTIVITE-PHARE', '<p># RESHAOC | LIVRET DU PARTICIPANT AUX JOURNÉES BIOMÉDICALES DU RESHAOC - MARDI 24 AU JEUDI 26 OCTOBRE 2023</p><p>www.reshaoc.org</p><p><br></p><p>Télécharger l’intégralité du livret du participant aux JBR/RESHAOC en cliquant sur : <a href=\"http://api.reshaoc.org/storage/app/public/actualite/U6CQrLumGYsdLZI7014JQdcl0GHUfVVOPNv0tc36.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">http://api.reshaoc.org/storage/app/public/actualite/U6CQrLumGYsdLZI7014JQdcl0GHUfVVOPNv0tc36.pdf</a></p><p>Cérémonie d\'ouverture - 9h00</p><p>Allocutions des personnalités officielles</p><p><br></p><p>- Pr Dieu donné GNONLONFOUN, Président du Comité d’Organisation International&nbsp;des Journées&nbsp;Biomédicales du RESHAOC, Secrétaire Exécutif du RESHAOC, Directeur Général du Centre National Hospitalier Universitaire Hubert Koutoukou Maga (CNHU-HKM), Cotonou (Bénin)</p><p><br></p><p>- Mme Khadidiatou SARR KEBE, Présidente du RESHAOC, Administrateur Hospitalier, Directeur&nbsp;du Centre Hospitalier Régional El Hadji Ibrahima Niass (CHREIN), Kaolack (Sénégal)</p><p><br></p><p>- M. Marc VIZY, Ambassadeur de France au Bénin</p><p><br></p><p>- Dr Al Fattah ONIFADE, Conseiller en charge des médicaments essentiels et des politiques pharmaceutiques, Bureau Pays de l’OMS au Bénin ou Dr Jean Kouamé KONAN, Représentant p.i. de l’OMS au Bénin - en attente de confirmation</p><p><br></p><p>- Allocution du Ministre de la santé du Bénin, Pr Benjamin HOUNKPATIN</p><p><br></p><p>@ RESHAOC/JBR</p><p>Thierry&nbsp;Laurent&nbsp;GLITHO</p>', '0000-00-00', NULL, 's0VLulCOGP3tx4ugyBUinPvtMgtI7jgu1uMzyRbY.pdf', NULL, '2023-10-22 04:31:24', '2023-10-22 12:49:23', NULL),
(40, 'wsPi413aZIpMlYVxd2tcrDo9abKQ83pQbGCoPBEF.jpg', 'LE LIVRET DU PARTICIPANT', 0, 'Télécharger l’intégralité du livret du participant aux JBR/RESHAOC en cliquant sur lien ci-dessous', 'PARTENARIAT-INTER-HOSPITALIERE', '<p>Télécharger l’intégralité du livret du participant aux JBR/RESHAOC <a href=\"http://api.reshaoc.org/storage/app/public/actualite/U6CQrLumGYsdLZI7014JQdcl0GHUfVVOPNv0tc36.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">http://api.reshaoc.org/storage/app/public/actualite/U6CQrLumGYsdLZI7014JQdcl0GHUfVVOPNv0tc36.pdf</a></p>', '0000-00-00', NULL, 'U6CQrLumGYsdLZI7014JQdcl0GHUfVVOPNv0tc36.pdf', NULL, '2023-10-22 07:23:06', '2023-10-22 07:27:12', NULL),
(41, 'tgli2gqU0BRbOgJCduyg41nO0yBPjfdoi76AmLd6.jpg', 'Premières Journées Biomédicales du RESHAOC', 1, 'Premières Journées Biomédicales du RESHAOC : L\'Afrique scientifique pose le débat de la gestion des équipements biomédicaux', 'ACTIVITE-PHARE', '<p>#SanteBenin | #GouvBenin | 🩸 Premières Journées Biomédicales du RESHAOC : L\'Afrique scientifique pose le débat de la gestion des équipements biomédicaux </p><p><br></p><p>Le Bénin accueille depuis ce mardi 24 octobre 2024, les Premières Journées Biomédicales du Réseau des Hôpitaux d’Afrique, de l’Océan indien et des Caraïbes (RESHAOC). Cette importante assise internationale porte à la réflexion collective des scientifiques présents, l’épineuse question de la gestion et de la maintenance des équipements biomédicaux. </p><p><br></p><p>Le Ministre de la Santé, Pr Benjamin HOUNKPATIN a procédé à l’ouverture des travaux en présence du Représentant Résident de l’OMS, Dr Kouamé Jean KONAN, de l’Ambassadeur de France près le Bénin, Son Excellence Monsieur Marc VIZY et de la présidente en exercice du RESHAOC, Madame Kebe Khadidiatou SARR. </p><p><br></p><p>🌐 Retrouvez l\'article intégral sur le site du Gouvernement =&gt; <a href=\"https://www.gouv.bj/article/2417/ \" rel=\"noopener noreferrer\" target=\"_blank\">https://www.gouv.bj/article/2417/ </a></p>', '0000-00-00', NULL, 'file.pdf', NULL, '2023-10-26 11:11:56', '2023-10-27 11:54:55', NULL),
(42, 'default.jpg', 'Priorité santé sur les Journées biomédicales du RESHAO', 0, 'En marge des Journées Biomédicales du Réseau des Hôpitaux d’Afrique, de l’océan Indien et des Caraïbes (RESHAOC), qui ont lieu du 24 au 26 octobre 2023 à Cotonou, nous abordons les défis de la gestion des hôpitaux en Afrique.', 'ARTICLE', '<p>Suivez l\'émission Priorité santé sur les Journées biomédicales du RESHAOC : diriger un hôpital en Afrique</p><p>Publié le : 26/10/2023 - 10:00, </p><p><br></p><p>En marge des Journées Biomédicales du Réseau des Hôpitaux d’Afrique, de l’océan Indien et des Caraïbes (RESHAOC), qui ont lieu du 24 au 26 octobre 2023 à Cotonou, nous abordons les défis de la gestion des hôpitaux en Afrique.</p><p><br></p><p>En termes de matériel, comme de ressources humaines et de formation, comment améliorer le fonctionnement des hôpitaux sur le continent ? Quel est le rôle des techniciens et ingénieurs biomédicaux ? Comment assurer des soins de qualité, quand les moyens manquent ? </p><p><br></p><p>Invités</p><p>- Pr Dieu donné Gnonlonfoun, directeur général du CNHU-HKM (Centre National Hospitalier Universitaire Hubert Koutoukou MAGA) à Cotonou et secrétaire exécutif de RESHAOC, neurologue, médecin de travail et neuro-épidémiologiste </p><p>- Khadidiatou Sarr Kebe, présidente du RESHAOC et directrice du Centre hospitalier régional Elhadji Ibrahima Niasse de Kaolack, au Sénégal </p><p>- Hady BA, technicien biomédical à l’Hôpital Nianankoro Fomba de Ségou, au Mali</p><p>- Dr Ange Dodji DOSSOU, Conseiller Technique du ministre de la Santé du Bénin à la Médecine Hospitalière</p><p><br></p><p>Emission réalisée avec le concours de la Fédération Hospitalière de France, avec le financement de l’Agence française de développement et avec la collaboration de la Direction Générale de l’Offre de Soins du ministère de la Santé et de la Prévention (France).</p><p><br></p><p>© Louise Caledec / RFI</p><p><a href=\"https://rfi.my/A3Bh\" rel=\"noopener noreferrer\" target=\"_blank\">https://rfi.my/A3Bh</a></p>', NULL, NULL, 'file.pdf', NULL, '2023-10-26 20:31:11', '2023-10-26 20:31:11', NULL),
(43, 'default.jpg', 'Priorité santé sur les Journées biomédicales du RESHAOC', 0, 'En marge des Journées Biomédicales du Réseau des Hôpitaux d’Afrique, de l’océan Indien et des Caraïbes (RESHAOC), qui ont lieu du 24 au 26 octobre 2023 à Cotonou, nous abordons les défis de la gestion des hôpitaux en Afrique.', 'ARTICLE', '<p>Suivez l\'émission Priorité santé sur les Journées biomédicales du RESHAOC : diriger un hôpital en Afrique</p><p>Publié le : 26/10/2023 - 10:00, </p><p><br></p><p>En marge des Journées Biomédicales du Réseau des Hôpitaux d’Afrique, de l’océan Indien et des Caraïbes (RESHAOC), qui ont lieu du 24 au 26 octobre 2023 à Cotonou, nous abordons les défis de la gestion des hôpitaux en Afrique.</p><p><br></p><p>En termes de matériel, comme de ressources humaines et de formation, comment améliorer le fonctionnement des hôpitaux sur le continent ? Quel est le rôle des techniciens et ingénieurs biomédicaux ? Comment assurer des soins de qualité, quand les moyens manquent ? </p><p><br></p><p>Invités</p><p>- Pr Dieu donné Gnonlonfoun, directeur général du CNHU-HKM (Centre National Hospitalier Universitaire Hubert Koutoukou MAGA) à Cotonou et secrétaire exécutif de RESHAOC, neurologue, médecin de travail et neuro-épidémiologiste </p><p>- Khadidiatou Sarr Kebe, présidente du RESHAOC et directrice du Centre hospitalier régional Elhadji Ibrahima Niasse de Kaolack, au Sénégal </p><p>- Hady BA, technicien biomédical à l’Hôpital Nianankoro Fomba de Ségou, au Mali</p><p>- Dr Ange Dodji DOSSOU, Conseiller Technique du ministre de la Santé du Bénin à la Médecine Hospitalière</p><p><br></p><p>Emission réalisée avec le concours de la Fédération Hospitalière de France, avec le financement de l’Agence française de développement et avec la collaboration de la Direction Générale de l’Offre de Soins du ministère de la Santé et de la Prévention (France).</p><p><br></p><p>© Louise Caledec / RFI</p><p><a href=\"https://rfi.my/A3Bh\" rel=\"noopener noreferrer\" target=\"_blank\">https://rfi.my/A3Bh</a></p>', NULL, NULL, 'file.pdf', NULL, '2023-10-26 20:31:34', '2023-10-26 20:31:34', NULL);
